import React, { useState } from "react";
import styles from "./eventCard.module.css";

const EventCard = () => {
  return (
    <div className={styles.eventCardWrapper}>
      <div className={styles.topHalf}>Event Name</div>
    </div>
  );
};

export default EventCard;
